import React from 'react'
import HeaderIcon from '../images/HeaderIcon.png'
import '../styles/header.scss'

function header() {
  return (
    <div className="header">
        <img src={HeaderIcon} alt="" />
        <span>Redberry Knight Cup</span>
    </div>
  )
}

export default header
